import React from "react";
import { SideBarContainer, Icon, CloseIcon } from "./SideBarElements";

const index = () => {
  return (
    <SideBarContainer>
      <Icon>
        <CloseIcon />
      </Icon>
      <SideBarWrapper>
        <SideBarMenu>
            <SideBarLink to = "about">
                About
            </SideBarLink>
            <SideBarLink to = "about">
                About
            </SideBarLink>
            <SideBarLink to = "about">
                About
            </SideBarLink>
            <SideBarLink to = "about">
                About
            </SideBarLink>
        </SideBarMenu>
      </SideBarWrapper>
    </SideBarContainer>
  );
};

export default index;
